namespace RonSijm.FluidHumidifier.Factories.IoTAnalytics;

public class DatasetFactory(string resourceName = null, Action<Humidifier.IoTAnalytics.Dataset> factoryAction = null) : ResourceFactory<Humidifier.IoTAnalytics.Dataset>(resourceName)
{

    internal List<InnerDatasetActionFactory> ActionsFactories { get; set; } = [];

    internal List<InnerDatasetLateDataRuleFactory> LateDataRulesFactories { get; set; } = [];

    internal List<InnerDatasetDatasetContentDeliveryRuleFactory> ContentDeliveryRulesFactories { get; set; } = [];

    internal List<InnerDatasetTriggerFactory> TriggersFactories { get; set; } = [];

    internal InnerDatasetVersioningConfigurationFactory VersioningConfigurationFactory { get; set; }

    internal InnerDatasetRetentionPeriodFactory RetentionPeriodFactory { get; set; }

    protected override Humidifier.IoTAnalytics.Dataset Create()
    {
        var datasetResult = CreateDataset();
        factoryAction?.Invoke(datasetResult);

        return datasetResult;
    }

    private Humidifier.IoTAnalytics.Dataset CreateDataset()
    {
        var datasetResult = new Humidifier.IoTAnalytics.Dataset
        {
            GivenName = InputResourceName,
        };

        return datasetResult;
    }
    public override void CreateChildren(Humidifier.IoTAnalytics.Dataset result)
    {
        base.CreateChildren(result);

        result.Actions = ActionsFactories.Any() ? ActionsFactories.Select(x => x.Build()).ToList() : null;
        result.LateDataRules = LateDataRulesFactories.Any() ? LateDataRulesFactories.Select(x => x.Build()).ToList() : null;
        result.ContentDeliveryRules = ContentDeliveryRulesFactories.Any() ? ContentDeliveryRulesFactories.Select(x => x.Build()).ToList() : null;
        result.Triggers = TriggersFactories.Any() ? TriggersFactories.Select(x => x.Build()).ToList() : null;
        result.VersioningConfiguration ??= VersioningConfigurationFactory?.Build();
        result.RetentionPeriod ??= RetentionPeriodFactory?.Build();
    }

} // End Of Class

